targets.query:
from(bucket: "monitoring")
|> range(start: v.timeRangeStart, stop:v.timeRangeStop)
|> filter(fn: (r) =>
  r._measurement == "processes" and
  r._field == "total_threads"
)

from(bucket: "monitoring")
|> range(start: v.timeRangeStart, stop:v.timeRangeStop)
|> filter(fn: (r) =>
  r._measurement == "processes" and
  r._field == "blocked"
)

from(bucket: "monitoring")
|> range(start: v.timeRangeStart, stop:v.timeRangeStop)
|> filter(fn: (r) =>
  r._measurement == "processes" and
  r._field == "dead"
)

from(bucket: "monitoring")
|> range(start: v.timeRangeStart, stop:v.timeRangeStop)
|> filter(fn: (r) =>
  r._measurement == "processes" and
  r._field == "idle"
)

from(bucket: "${buckets}")
|> range(start: v.timeRangeStart, stop:v.timeRangeStop)
|> filter(fn: (r) =>
  r._measurement == "kubernetes_node" and
  r._field == "cpu_usage_core_nanoseconds" //and
  //r.host == "${host}"
)
|> aggregateWindow(every: 1m, fn: mean)

from(bucket: "monitoring")
|> range(start: v.timeRangeStart, stop:v.timeRangeStop)
|> filter(fn: (r) =>
  r._measurement == "kubernetes_node" and
  r._field == "cpu_usage_nanocores" //and
  //r.host == "${host}"
)
|> aggregateWindow(every: 1m, fn: mean)

from(bucket: "monitoring")
|> range(start: v.timeRangeStart, stop:v.timeRangeStop)
|> filter(fn: (r) =>
  r._measurement == "kubernetes_node" and
  r._field == "fs_available_bytes" //and
  //r.host == "${host}"
)
|> aggregateWindow(every: 1m, fn: mean)
